var hitTimes = [0, 0, 0];
var hiterator = 0;

var hitmarkerID = "hornAudio";

interventionAudio = new Audio();
interventionAudio.src = intervention_ogg;
document.body.appendChild(interventionAudio);

darudeAudio = new Audio();
darudeAudio.src = darude_ogg;
document.body.appendChild(darudeAudio);

wowAudio = new Audio();
wowAudio.src = wow_mp3;
document.body.appendChild(wowAudio);

sanicAudio = new Audio();
sanicAudio.src = sanic_mp3;
document.body.appendChild(sanicAudio);

function mark(x, y) {
    hitTimes[hiterator++ % 3] = Date.now();
    var hitTimeDiffs = Math.abs(hitTimes[0] - hitTimes[1]) + Math.abs(hitTimes[1] - hitTimes[2]);
    if (hitTimeDiffs < 1000) {
        tripleAudio = new Audio();
        tripleAudio.src = triple_ogg;
        document.body.appendChild(tripleAudio);
        tripleAudio.play();
    }

    img = new Image();
    img.src = hitmarker_png;
    img.style.position = "fixed";
    img.style.left = (x - 24) + "px";
    img.style.top = (y - 24) + "px";
    img.style.webkitPointerEvents = "none";
    img.style.mozPointerEvents = "none";
    img.style.webkitUserSelect = "none";
    img.style.mozUserSelect = "none";
    img.style.zIndex = "1000";
    document.documentElement.appendChild(img);

    /*audio = new Audio();
    audio.src = hitmarker_ogg;
    document.body.appendChild(audio);
    audio.play();*/
    var nextID = hitmarkerID + $("#" + hitmarkerID).length;
    addSound(nextID, hitmarker_ogg);
    playSound(nextID);

    window.setTimeout(function() {
        document.documentElement.removeChild(img);
        //document.body.removeChild(audio);
        //removeSound(nextID);
    }, 50);
}

function addSound(id, src) {
    if ($("#" + id).length)
        changeSound(id, src)
    else
        $("body").append('<audio id="' + id + '" src="' + src + '" preload="auto"></audio>');
}

function removeSound(id) {
    $("#" + id).remove();
}

function playSound(id) {
    $('#' + id)[0].play();
}

function changeSound(id, sound) {
    $("#" + id).attr("src", sound);
}

var css = document.createElement("style");
css.type = "text/css";
css.innerHTML = "* { font-family: \"Comic Sans MS\" !important; }";

