var cursometer;

MLG.prototype.start = function() {
    running = true;
    console.info("%c[BetterDiscord]" + " %c" + this.getName() + " v" + this.getVersion() + " by " + this.getAuthor() + " started.", "color: purple; font-weight: bold;", "");
    document.addEventListener("click", doMark);
    document.addEventListener("keypress", doIntervention);
    document.getElementsByClassName("scroller messages")[0].addEventListener("scroll", doHorn);
    document.body.appendChild(css);
    darudeAudio.play();
    $('html').addClass('sanic');
    cursometer = $('.sanic').cursometer({
        onUpdateSpeed: function(speed) {
            if (running) {
                var currSpeed = parseInt(speed);
                if (currSpeed > 40) {
                    sanicAudio.play();
                }
            }
        },
        updateSpeedRate: 20
    });
};

function doMark(evt) {
    evt = (evt || event);
    mark(evt.clientX, evt.clientY);
}

function doHorn(evt){
    hornAudio = new Audio();
    hornAudio.src = hitmarker_ogg;
    document.body.appendChild(hornAudio);
    hornAudio.play();
    intensifyScrolling();
}

function doIntervention(evt) {
    evt = (evt || event);
    if (evt.which == 13) {
        interventionAudio.play();
    }
}

function dankNames(obj) {
    var name = obj.innerText;
    if (name.substring(0, 3) != "xXx") {
        var mlg = "xXx" + name + "xXx";
        obj.innerText = mlg;
    }
}

function dankNamesAll() {
    if (running) {
        $('.user-name').each(function(i, obj) {
            dankNames(obj);
        });
    }
}


MLG.prototype.stop = function() {
    running = false;
    console.info("%c[BetterDiscord]" + " %c" + this.getName() + " v" + this.getVersion() + " by " + this.getAuthor() + " stopped.", "color: purple; font-weight: bold;", "");
    document.removeEventListener("click", doMark);
    document.removeEventListener("keypress", doIntervention);
    document.getElementsByClassName("scroller messages")[0].removeEventListener("scroll", doHorn);
    document.body.removeChild(css);
    $('.user-name').each(function(i, obj) {
        var mlg = obj.innerText;
        var name = mlg.slice(3).slice(0, -3);
        if (mlg.substring(0, 3) == "xXx") {
            obj.innerText = name;
        }
    });
};

var scrollIntensificationInProgress = false;

function intensifyScrolling() {
    if (scrollIntensificationInProgress)
        return;
    scrollIntensificationInProgress = true;
    var txtDiv = document.createElement("div");
    txtDiv.innerText = "[scrolling intensifies]";
    txtDiv.style.position = "fixed";
    txtDiv.style.top = "45%";
    txtDiv.style.left = "40%";
    txtDiv.style.fontSize = "600%";
    txtDiv.style.zIndex = "1000";
    document.documentElement.appendChild(txtDiv);
    var id, prg = 0, theta = 0, updateSeizure = function() {
        theta = Math.sin(prg*10.)*3;
        txtDiv.style.transform = "rotate(" + theta + "deg)";
        txtDiv.style.WebkitTransform = "rotate(" + theta + "deg)";
        if(prg++ > 100) {
            window.clearInterval(id);;
            document.documentElement.removeChild(txtDiv);
            scrollIntensificationInProgress = false
        }
    };
    id = window.setInterval(updateSeizure, 1000/60);
}

MLG.prototype.onMessage = function() {
    console.info("%c[BetterDiscord]" + " %c" + this.getName() + " v" + this.getVersion() + " by " + this.getAuthor() + " [onMessage] event fired.", "color: purple; font-weight: bold;", "");
    var numUsers = $('.user-name').length;
    var obj = $('.user-name')[numUsers - 1];
    dankNames(obj);
    wowAudio.play();
};
MLG.prototype.onSwitch = function() {
    document.getElementsByClassName("scroller messages")[0].addEventListener("scroll", doHorn);
    console.info("%c[BetterDiscord]" + " %c" + this.getName() + " v" + this.getVersion() + " by " + this.getAuthor() + " [onSwitch] event fired.", "color: purple; font-weight: bold;", "");
};
